  [],\n\t\"revision_timestamp\": \"2016-07-27T23:01:41.982607\",\n\t\"name\": \"a-field-survey-of-bird-use-at-beaufort-lagoon\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Bird surveys conducted at Beaufort Lagoon
  located along the northern periphery of the Arctic National Wildlife Refuge from
  June-September 1970. The Lagoon area contains habitat and bird and animal life found
  on no other federally protected land. Migratory birds using the area include black
  brant, snow goose, common eider, king eider, spectacled eider, white-winged scoter,
  surf scoter, common scoter, whistling swan) Canada goose, white-fronted goose, pintail,
  and various other ducks, shorebirds, and waterbirds. The lagoon area consists of
  16 avian habitat types (modified from Kessel & Cade, 1958). The major types include
  sedge-grass marsh, tussock-heath tundra, tundra-freshwater pond or lake edge, river
  waters, lagoon, and the reef.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
